              "videoId": "g9eqLONM7Cw",
              "textDisplay": "@Watts Truman Por lógica, seguro que allí hay una emigración y por la ley del país pues sea la emigración más chunga de conseguir para el ciudadano que así lo desee. Eso sin duda. \u003cbr\u003ePero ahora, cuando dices lo de que los matan en la frontera, etc... Yo se porqué lo dices, hemos visto periodistas haciendo documentales allí que lo comentan, eso si, 0 imágenes muestran. Lo único parecido que he visto es uno en concreto entrevistando a una familia y a una mujer. Si suponemos que es 100% verdad ese testimonio, casos así ocurren en muchos otros países, no sería una excepción Corea del Norte. Pero sinceramente, sabiendo que es el enemigo nº1 a derrotar con prensa mediática me fio nada o menos de documentales de origen yankee. Más aún cuando se destapó la cagada de uno de esos, cuyo director era Noruego o Sueco... no recuerdo bien\u003cbr\u003e\u003cbr\u003eYo no soy fan de Corea del Norte, para nada, lo mío es ver las cosas desde un punto neutral, y Corea nos pilla tan lejos, y lo que recibimos es información completamente adulterada (como muchos otros casos más fáciles de darse cuenta). Que mira... Primero no es una dictadura le pese a quien le pese.  Si lees sus sistema. político y lees como salió elegido el actual líder lo tienes ahí. Y añade una cosa, que es la cultuera oriental. Piensa en los yakuza por ejemplo, tema de castas, familias, honor... eso es así en todo oriente. Por lo tanto es su cultura. Yo la respeto. E insisto no es una dictadura, es cuando alguien dice que lo es, directamente está partiendo de un concepto ya erróneo, sabes lo que digo? Pero es mi opinión claro.",
